void koneplus_rmp_free(KoneplusRmp *rmp) {
	if (rmp) {
		g_key_file_free(rmp->key_file);
		g_free(rmp);
	}
}

KoneplusRmp *koneplus_rmp_dup(KoneplusRmp const *src) {
	KoneplusRmp *dest = g_malloc0(sizeof(KoneplusRmp));
	guint i;

	dest->key_file = roccat_key_file_dup(src->key_file);
	dest->default_key_file = src->default_key_file;
	dest->modified_rmp = src->modified_rmp;
	dest->modified_settings = src->modified_settings;
	for (i = 0; i < KONEPLUS_PROFILE_BUTTON_NUM; ++i)
		dest->modified_macros[i] = src->modified_macros[i];

	return dest;
}

KoneplusRmp *koneplus_rmp_read_with_path(gchar const *path, GKeyFile *default_key_file, GError **error) {
	KoneplusRmp *rmp = g_malloc0(sizeof(KoneplusRmp));
	rmp->key_file = g_key_file_new();
	rmp->default_key_file = default_key_file;

	if (!g_key_file_load_from_file(rmp->key_file, path, G_KEY_FILE_NONE, error)) {
		koneplus_rmp_free(rmp);
		return NULL;
	}

	return rmp;
}

gboolean koneplus_rmp_write_with_path(gchar const *path, KoneplusRmp *rmp, GError **error) {
	gchar *data;
	gsize size;
	gboolean ret;

	data = g_key_file_to_data(rmp->key_file, &size, error);
	if (!data)
		goto error;

	ret = roccat_profile_write_with_path(path, data, size, error);
	g_free(data);
	if (!ret)
		goto error;

	return TRUE;
error:
	g_warning(_("Could not write rmp %s: %s"), path, (*error)->message);
	return FALSE;
}

GKeyFile *koneplus_rmp_defaults(void) {
	static GKeyFile *values = NULL;
	GError *error = NULL;

	if (values == NULL) {
		values = g_key_file_new();
		if (!g_key_file_load_from_data(values, (gchar const *)default_rmp_data, sizeof(default_rmp_data), 0, &error)) {
			g_clear_pointer(&values, g_key_file_free);
			g_critical(_("Could not create default rmp: %s"), error->message);
			g_error_free(error);
		}
	}

	return values;
}

KoneplusRmp *koneplus_default_rmp(void) {
	KoneplusRmp *rmp = g_malloc0(sizeof(KoneplusRmp));
	rmp->key_file = roccat_key_file_dup(koneplus_rmp_defaults());
	rmp->default_key_file = koneplus_rmp_defaults();
	return rmp;
}
